var $bm_rt;
var txt, txt_w, comp_w, N, max, x, x, y;
txt = thisComp.layer('text2.1');
txt_w = txt.sourceRectAtTime(time, true).width;
comp_w = thisComp.width;
N = div(thisComp.layer('text2.1').effect('Width Limit')('Slider').value, 100);
max = mul(comp_w, N);
if (txt_w > max) {
    x = div(mul(max, 100), txt_w);
} else {
    x = 100;
}
y = x;
$bm_rt = [
    x,
    y
];

